import React, { useState } from 'react'
import { Link } from 'react-router-dom'

function Signup() {
  const [credentials,setcredentials] = useState({name:"",email:"",password:"",geolocation:""})

  const handlesubmit= async(e)=>{
    e.preventDefault();
    const response=fetch("http://localhost:5000/api/creatuser",{
        method:'POST',
        headers:{
            'Content-Type':'application/json'
        },
        body:JSON.stringify()
  })
}
const onChange=(event)=>{
setcredentials({...credentials,[event.target.name]:event.target.value})
}

  return (
    <>
    <div className='container'>
     <form onSubmit={handlesubmit}>
     <div className="mb-3">
    <label for="name" className="form-label">Name</label>
    <input type="text" className="form-control" name="name" value={credentials.name} onChange={onChange}/>
  </div>
  <div className="mb-3">
    <label for="exampleInputEmail1" className="form-label">Email address</label>
    <input type="email" className="form-control" email="email" value={credentials.name} onChange={onChange} id="exampleInputEmail1" aria-describedby="emailHelp"/>
    <div id="emailHelp" className="form-text">We'll never share your email with anyone else.</div>
  </div>
  <div className="mb-3">
    <label for="exampleInputPassword1" className="form-label">Password</label>
    <input type="password" className="form-control" password="password" value={credentials.name} onChange={onChange} id="exampleInputPassword1"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputPassword1" className="form-label">Address</label>
    <input type="text" className="form-control" name="geolocation" value={credentials.name} onChange={onChange}  id="exampleInputPassword1"/>
  </div>
  <button type="submit" className="m-3 btn btn-success">Submit</button>
  <Link to="/login" className='m-3 btn btn-danger'>Already a User</Link>
</form>   
</div>
    </>
  )
}

export default Signup
